import React from "react";

export const TextField = ({ placeholder }) => (
  <input
    placeholder="{placeholder}"
    style={{
      borderWidth: "2px",
      borderColor: "#FF8300",
      width: "10vw",
      height: "5vh",
      borderRadius: "30px",
      outline: "none",
      color: "black"
    }}
  />
);
